import React from "react";
import officeBuilding from "./office-building.jpeg";
import "./statistics.css";
import Counter from "./Counter";
export default class Statistics extends React.Component {
  render() {
    return (
      <section class="statisticsSection">
        <div
          className="statistics"
          style={{ backgroundImage: `url(${officeBuilding})` }}
        >
          <div className="statisticsOverLay">
            <div className="statisticsContainer">
              <div className="stat">
                <div className="statIcon">
                  <i className="fa-solid fa-list-check"></i>
                </div>
                <span>
                  <Counter maxCount="500" duration="3"></Counter>
                </span>
                <span>+</span>
                <div class="statDescription">Projects Delivered</div>
              </div>
            </div>
          </div>
        </div>
      </section>
    );
  }
}
